// src/App.jsx
import React, { useEffect, Suspense } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { CssBaseline, Box } from '@mui/material';
import { Provider } from 'react-redux';
import { PersistGate } from 'redux-persist/integration/react';

// Store imports
import { store, persistor } from './store';

// Context imports
import { ErrorProvider } from './contexts/ErrorContext';

// Component imports
import LoadingSpinner from './components/common/LoadingSpinner';
import ErrorBoundary from './components/common/ErrorBoundary';
import AuthGuard from './components/auth/AuthGuard';

// Lazy load pages
const HomePage = React.lazy(() => import('./pages/HomePage'));
const DashboardPage = React.lazy(() => import('./pages/DashboardPage'));
const ChallengePage = React.lazy(() => import('./pages/ChallengePage'));
const IndividualChallengePage = React.lazy(() => import('./pages/IndividualChallengePage'));
const LeaderboardPage = React.lazy(() => import('./pages/LeaderboardPage'));
const ProfilePage = React.lazy(() => import('./pages/ProfilePage'));

// Create theme
const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#1976d2',
      light: '#42a5f5',
      dark: '#1565c0',
    },
    secondary: {
      main: '#dc004e',
      light: '#ff5983',
      dark: '#9a0036',
    },
    background: {
      default: '#0a0e1a',
      paper: '#1a1f2e',
    },
    text: {
      primary: '#ffffff',
      secondary: 'rgba(255, 255, 255, 0.7)',
    },
  },
  typography: {
    fontFamily: '"Roboto", "Helvetica", "Arial", sans-serif',
    h1: {
      fontSize: '2.5rem',
      fontWeight: 600,
    },
    h2: {
      fontSize: '2rem',
      fontWeight: 600,
    },
    h3: {
      fontSize: '1.75rem',
      fontWeight: 600,
    },
  },
  shape: {
    borderRadius: 8,
  },
  components: {
    MuiButton: {
      styleOverrides: {
        root: {
          textTransform: 'none',
          borderRadius: 8,
        },
      },
    },
    MuiCard: {
      styleOverrides: {
        root: {
          borderRadius: 12,
        },
      },
    },
    MuiPaper: {
      styleOverrides: {
        root: {
          borderRadius: 12,
        },
      },
    },
  },
});

// Loading component for PersistGate
const PersistGateLoading = () => (
  <Box 
    display="flex" 
    justifyContent="center" 
    alignItems="center" 
    minHeight="100vh"
    bgcolor="background.default"
  >
    <LoadingSpinner />
  </Box>
);

// Main App component
function App() {
  // Handle screen resize for responsive design
  useEffect(() => {
    const handleResize = () => {
      // You can dispatch screen size updates to Redux if needed
      console.log('Screen resized:', window.innerWidth, window.innerHeight);
    };

    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  return (
    <Provider store={store}>
      <PersistGate loading={<PersistGateLoading />} persistor={persistor}>
        <ThemeProvider theme={theme}>
            <CssBaseline />
            <ErrorProvider>
              <ErrorBoundary>
                <Router>
                  <Box 
                    sx={{ 
                      display: 'flex', 
                      flexDirection: 'column', 
                      minHeight: '100vh',
                      bgcolor: 'background.default'
                    }}
                  >
                    <Suspense fallback={<LoadingSpinner />}>
                      <Routes>
                        {/* Public routes */}
                        <Route path="/" element={<HomePage />} />
                        <Route path="/login" element={<HomePage />} />
                        <Route path="/register" element={<HomePage />} />
                        
                        {/* Protected routes */}
                        <Route 
                          path="/dashboard" 
                          element={
                            <AuthGuard>
                              <DashboardPage />
                            </AuthGuard>
                          } 
                        />
                        <Route 
                          path="/challenges" 
                          element={
                            <AuthGuard>
                              <ChallengePage />
                            </AuthGuard>
                          } 
                        />
                        <Route 
                          path="/challenges/:challengeId" 
                          element={
                            <AuthGuard>
                              <IndividualChallengePage />
                            </AuthGuard>
                          } 
                        />
                        <Route 
                          path="/leaderboard" 
                          element={
                            <AuthGuard>
                              <LeaderboardPage />
                            </AuthGuard>
                          } 
                        />
                        <Route 
                          path="/profile" 
                          element={
                            <AuthGuard>
                              <ProfilePage />
                            </AuthGuard>
                          } 
                        />
                        
                        {/* Fallback route */}
                        <Route path="*" element={<Navigate to="/" replace />} />
                      </Routes>
                    </Suspense>
                  </Box>
                </Router>
              </ErrorBoundary>
            </ErrorProvider>
        </ThemeProvider>
      </PersistGate>
    </Provider>
  );
}

export default App;
